//SPDX-License-Identifier:MIT
pragma solidity ^0.8.0;
contract User{
    
    enum Status {
        ok,
        notok
    }
    address public owner;

    Status public  currentStatus;
    constructor(){
        owner= (msg.sender);
        currentStatus=Status.notok;
    }

    mapping(address=>bool) public allot;

    modifier onlyWhileVacant{
        require(currentStatus==Status.ok,"already Alloted");
        _;
    }

    function pay() public payable onlyWhileVacant {
        
        if((msg.value)>=2 ether){
             currentStatus=Status.ok;
             
             allot[msg.sender]=true;
        }

        else if((msg.value)<2 ether){
            currentStatus= Status.notok;
        }
    }
}

